import React from 'react';
import DataTable from '../../services/reactTable';
import styled from 'styled-components';

const AnalysisTable = ({ tableData }) => {
  // const { tableData } = props;
  console.log(tableData, 'AnalysisTable');
  return (
    <Styles>
      <table>
        {/* <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
          </tr>
        </thead> */}
        <tbody>
          {tableData.length && tableData.length > 0 ? (
            tableData.map((droplet, index) => {
              return (
                <tr key={index}>
                  <td>{droplet.style_id}</td>
                  <td>{droplet.style_desc}</td>
                </tr>
              );
            })
          ) : (
            <tr>
              <td colSpan="5">Loading...</td>
            </tr>
          )}
        </tbody>
      </table>
    </Styles>
  );
};
